// src/pages/PetList.jsx
import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';

const PetList = () => {
  const [pets, setPets] = useState([]);

  useEffect(() => {
    // Se você configurou "proxy" no package.json do frontend, pode usar apenas '/api/pets'
    axios.get('http://localhost:5000/api/pets')
      .then(res => setPets(res.data))
      .catch(err => console.error('Erro ao buscar pets:', err));
  }, []);

  return (
    <div className="container my-5">
      <div className="d-flex justify-content-between align-items-center">
        <h2>Pets Cadastrados</h2>
        <Link to="/pets/novo" className="btn btn-primary">
          + Cadastrar Novo Pet
        </Link>
      </div>

      <ul className="list-group mt-3">
        {pets.map(pet => (
          <li key={pet._id} className="list-group-item">
            <Link to={`/pets/${pet._id}`} className="text-decoration-none">
              <strong>{pet.nome}</strong> – {pet.raca} ({pet.porte})
            </Link>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default PetList;
